  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom'
import AllRoutes from './components/AllRoutes';

function App() {
  return (
    <Router>
      <Navbar />
      <Home />
      <AllRoutes />
    </Router>
  );
}

export default App;
